import Navbarcomponent from "../navbar";
import { NavDropdown } from "react-bootstrap";

function AdminDashboard(){
  return(<div>
    <Navbarcomponent/>
    <div>
    <NavDropdown title="Options" id="basic-nav-dropdown">
      <NavDropdown.Item >
        Add Book
      </NavDropdown.Item>
      <NavDropdown.Item >
        Update Book
      </NavDropdown.Item>
      <NavDropdown.Item >
        Delete Book
      </NavDropdown.Item>
    </NavDropdown>
    </div>
    <div>'
      {process}
    </div>

  </div>

  );
}
export default AdminDashboard;
